import React, { useState } from 'react';
import PageContainer from './PageContainer';

const App = () => {
    const numRows = 22;
    const numCols = 15;
    const [plateau, setPlateau] = useState(Array.from({ length: 1 + numRows + 1 }, () => Array(1 + numCols + 1).fill(0)));

    return (
        <PageContainer
            numRows={numRows}
            numCols={numCols}
            plateau={plateau}
            setPlateau={setPlateau}
        />
    );
};

export default App;
